import React, { Component } from "react";
import pic from "./poster1.jpg";

function Show() {
  return (
    <div className="Show">
      <div className="row">
        <h1>Popular Movies</h1>
        <img src={pic} />
      </div>
      <div className="row"></div>
      <div className="row"></div>
    </div>
  );
}

export default Show;
